; == Very crude PoC of a 128x128px tilemap rotation ==

; To build: cl65 -t cx16 -o ONEBIT.PRG onebit.s
; To run: x16emu.exe -prg ONEBIT.PRG -run

.org $080D
.segment "STARTUP"
.segment "INIT"
.segment "ONCE"
.segment "CODE"

   jmp start

; TODO: The following is *copied* from my x16.s (it should be included instead)

; -- some X16 constants --

VERA_ADDR_LOW     = $9F20
VERA_ADDR_HIGH    = $9F21
VERA_ADDR_BANK    = $9F22
VERA_DATA0        = $9F23
VERA_DATA1        = $9F24
VERA_CTRL         = $9F25

VERA_DC_VIDEO     = $9F29  ; DCSEL=0
VERA_DC_HSCALE    = $9F2A  ; DCSEL=0
VERA_DC_VSCALE    = $9F2B  ; DCSEL=0

VERA_L0_CONFIG    = $9F2D
VERA_L0_TILEBASE  = $9F2F



; === Zero page addresses ===


LOAD_ADDRESS              = $30 ; 31


start:

    jsr setup_vera_for_layer0_bitmap_1bpp

    jsr copy_bitmap_data_to_vram
    
    ; We are not returning to BASIC here...
infinite_loop:
    jmp infinite_loop
    
    rts


setup_vera_for_layer0_bitmap_1bpp:

    lda VERA_DC_VIDEO
    ora #%00010000           ; Enable Layer 0 
    and #%10011111           ; Disable Layer 1 and sprites
    sta VERA_DC_VIDEO

    lda #$80                 ; 2:1 scale (640 x 480 pixels on screen)
    sta VERA_DC_HSCALE
    sta VERA_DC_VSCALE
    
    ; -- Setup Layer 0 --
    
    lda #%00000000           ; DCSEL=0, ADDRSEL=0
    sta VERA_CTRL
    
    ; Enable bitmap mode and color depth = 1bpp on layer 0
    lda #(4+0)
    sta VERA_L0_CONFIG

    ; Set layer0 tilebase to 0x00000 and tile width to 640 px
    lda #1
    sta VERA_L0_TILEBASE

    rts



copy_bitmap_data_to_vram:    
    
    ; For image convert: https://lvgl.io/tools/imageconverter
    ; Choose 1bit export

    ; The 1-bit bitmap image is 512 pixel wide (so 64 bytes) and 342 lines high
    ; After each 512 pixels we have to add 128 (so 16 bytes) of black pixels
    ; We also need to XOR the data (since its inverted)
    
    lda #<bitmap_pixel_data
    sta LOAD_ADDRESS
    lda #>bitmap_pixel_data
    sta LOAD_ADDRESS+1

    lda #%00010000      ; setting bit 16 of vram address to the highest bit in the tilebase (=0), setting auto-increment value to 1
    sta VERA_ADDR_BANK
    stz VERA_ADDR_LOW
    stz VERA_ADDR_HIGH
    
    ; Top border

    ldx #0
add_top_border_row:

    ldy #80
add_top_border_pixel:
    stz VERA_DATA0
    dey
    bne add_top_border_pixel
    
    inx
    cpx #69
    bne add_top_border_row


    ; This shift the picture to the right
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    stz VERA_DATA0
    
    ; First 256 rows
    
    ldx #0
copy_next_row_to_vram_0:

    ldy #0
copy_next_8_pixels_vram_0:
    lda (LOAD_ADDRESS),y
    eor #$FF
    sta VERA_DATA0
    iny
    cpy #64
    bne copy_next_8_pixels_vram_0
    
    ldy #16
add_right_border_pixel_0:
    stz VERA_DATA0
    dey
    bne add_right_border_pixel_0
    
    clc
    lda LOAD_ADDRESS
    adc #64
    sta LOAD_ADDRESS
    lda LOAD_ADDRESS+1
    adc #0
    sta LOAD_ADDRESS+1

    inx
    bne copy_next_row_to_vram_0


    ; Last 342-256 rows


    ldx #0
copy_next_row_to_vram:  

    ldy #0
copy_next_8_pixels_vram:
    lda (LOAD_ADDRESS),y
    sta VERA_DATA0
    iny
    cpy #64
    bne copy_next_8_pixels_vram
    
    ldy #16
add_right_border_pixel:
    stz VERA_DATA0
    dey
    bne add_right_border_pixel
    
    clc
    lda LOAD_ADDRESS
    adc #64
    sta LOAD_ADDRESS
    lda LOAD_ADDRESS+1
    adc #0
    sta LOAD_ADDRESS+1

    inx
    cpx #(342-256)
    bne copy_next_row_to_vram

    ; Bottom border

    ldx #0
add_bottom_border_row:

    ldy #80
add_bottom_border_pixel:
    stz VERA_DATA0
    dey
    bne add_bottom_border_pixel
    
    inx
    cpx #69
    bne add_bottom_border_row

    
    rts
    
    
